import React from 'react';
import { Nav, Navbar, Form, FormControl } from 'react-bootstrap';
import styled from 'styled-components';
const Styles = styled.div`
  .navbar { background-color: #074b5a; }
  a, .navbar-nav, .navbar-light .nav-link {
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .navbar-brand {
    font-size: 1.4em;
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .form-center {
    position: absolute !important;
    left: 25%;
    right: 25%;
  }
`;
export const NavigationBar = () => (






  
  <Styles>
    <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Container>
  <Navbar.Brand href="/">A</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="me-auto">
      <Nav.Link href="/Home">Home</Nav.Link>
      <Nav.Link href="/Home/TPage">CX</Nav.Link>
      <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
        <NavDropdown.Item href="/Home">Action</NavDropdown.Item>
        <NavDropdown.Item href="/Home">Another action</NavDropdown.Item>
        <NavDropdown.Item href="/Home">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="/Home">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Nav>
      <Nav.Link href="#deets">More deets</Nav.Link>
      <Nav.Link eventKey={2} href="#memes">
        Dank memes
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
  </Container>
</Navbar>
   {/*  <Navbar expand="lg">
      <Navbar.Brand href="/">A</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav"/>
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav variant="tabs" className="justify-content-end">
          <Nav.Item><Nav.Link href="/Home">Home</Nav.Link></Nav.Item> 
          <Nav.Item><Nav.Link href="/Home/TPage">CX</Nav.Link></Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar> */}
  </Styles>
)
